package Receiver;import com.sonycsl.echo.Echo;public class MyEchoEventListener extends Echo.EventListener implements ResultControllable {      private OnReceiveResultListener onItemSetChanging;      @Override      public void setOnReceiveListener(OnReceiveResultListener onSetEPC, OnReceiveResultListener onItemSetChanging) {            this.onItemSetChanging = onItemSetChanging;      }      @Override      public OnReceiveResultListener getOnGetListener() {            return onItemSetChanging;      }      @Override      public OnReceiveResultListener getOnItemSetChangingListener() {            return onItemSetChanging;      }}